			case MSG_GLOBALPUBLISHER_ADMIN_REREAD_INIDATA_REPLY: Protocol_MSG_GLOBALPUBLISHER_ADMIN_REREAD_INIDATA_REPLY::validateJSONString(_jsonString, _checker, _fieldsNotParseEnded); return true;
